import React, { Component } from 'react';
import '../App.css'



displayStacks = (stacks) => {

  if (stacks.length !== 0) {
    let stacksInJSX = [];
    stacks.forEach((stack, i) => {
      stacksInJSX.push(
        <Stack name={stack.name} key={i} habits={stack.habits}/>
      )
    });
    return stacksInJSX;
  }
  else {
    return <p>Tap + to add stacks, habits, & friends</p>
  }
}

function Stack(props){
  return (
    <div className="stack">
      <div className="stackHeader">
        <div className="toggle">
          <div className="bar"></div>
          <div className="bar"></div>
          <div className="bar"></div>
        </div>
        <h3 className="stackName">{props.name}!</h3>
      </div>
      <div className="stackBody">
        {props.habits}
      </div>
    </div>
  )
}

export default Stack;
